import React from 'react'

export default function Donut() {
	const series = [44, 55, 41, 17, 15]
	const options = {
	  chart: {
		type: 'donut',
	  },
	  responsive: [{
		breakpoint: 480,
		options: {
		  chart: {
			width: 200
		  },
		  legend: {
			position: 'bottom'
		  }
		}
	  }]
	}

	return (
		<div>
		  <div id="chart">
			<ReactApexChart options={this.state.options} series={this.state.series} type="donut" />
		  </div>
		  <div id="html-dist"></div>
		</div>
	  );
}
